function pdf4print(data){
    
    var docInfo = {
        info: {
            title: 'Заказ «' + data[0] + '»',
            author: 'ПРАКТИКА'
        },
        
        pageSize: 'A4',
        pageOrientation: 'portrait',
        pageMargins: [20,50,20,100],

        content:[
            {
                image: 'data:image/png;base64,',
                width: 50,
                margin: [15, 0, 0, 15] 
            },
            {
                text: 'Заказ «' + data[0] + '»',
                style: 'header'
            },
            {
                text: '\n\n'
            }
        ],
        
        styles: {
            header: {
                fontSize: 14,
                bold: true,
                color: 'black',
                alignment: 'center'
            },
            table: {
                fontSize: 8,
                bold: false,
                color: 'black',
                alignment: 'center'
            },
            tabheader: {
                fontSize: 8,
                bold: true,
                color: 'white',
                fillColor: 'black',
                alignment: 'center'
            }
        }        
    };
  
    if(typeof data[1] !== 'undefined' && data[1].length > 0){
        var column_one = {
            table: {
                headerRows: 1,
                widths: ['6%', '74%', '6%', '7%', '7%'],
                body: [
                    ["№", "наименование","кол-во","цена","сумма"]
                ]                    
            },
            style: 'tabheader'
        };

        docInfo.content.push(column_one);

        var tab_one = {
            table: {
                headerRows: 1,
                widths: ['6%', '74%', '6%', '7%', '7%'],
                body: data[1]                    
            },
            style: 'table'
        };

        docInfo.content.push(tab_one);
        
        var one_sum = {
            table: {
                headerRows: 1,
                widths: ['6%', '74%', '6%', '7%', '7%'],
                body: [
                    [{text: "", border: [false, false, false, false]}, {text: "", border: [false, false, false, false]}, {text: "", border: [false, false, false, false]}, {text: "", border: [false, false, false, false]}, {text: data[2], border: [true, true, true, true], fillColor: 'black', color: 'white', fontSize: 8, bold: true, alignment: 'center'}]
                ]                    
            }
        };

        docInfo.content.push(one_sum);
        
    }
     
    pdfMake.createPdf(docInfo).download();
}

